        return (
            <div>
                <h1 className="welcome">Welcome to Shortest Path Visualizer</h1>
                <h3>
                    This short guide is an user-manual for all the features in
                    this application.
                </h3>
                <p className="modal1">
                    It is strongly recommended to go thorugh this. But feel free
                    to skip.
                </p>
                <img src={iconImage} />
            </div>
        );
    } else {
        return (
            <div>
                <h1>hello 2</h1>
            </div>
        );
    }
};

export default Tutorial;
